ポルシェ964CUP/RSR、993RSR/GT2、996RSR/CUPなどの歴代レーシングモデルに標準装着されていたポルシェモータースポーツ純正のバックスキンステアリングです。MOMO製07モデルをベースとし「PORSCHE」ロゴをあしらった大変希少価値の高いアイテムです。但し964/993当時はトップのイエロー目印が付いていませんでした。 <br><br>●素材：バックスキンレザー（グリップ部） ●カラー：ブラック ●ステアリング径：350 ●ディッシュ：コーンオフセット●グリップ形状：ラウンド（円） ●ポルシェホーンボタン付属 ●ステアリングボス付属（エアバッグキャンセラー無） ●ポルシェモータースポーツ純正品<br><br>※コラムシャフトのスプラインは964～996まで（997は未確認）同一なので付属のボスで装着は可能ですが、エアバッグ付き車両への警告灯キャンセラー配線は付属しません。エアバッグ装着車両の場合、ホーン配線は加工が必要になります。エアバッグ装着車両へ取り付けの際は加工不要なエアバッグ対応ボスを別途お買い求めください。 <br><br>適合車種：ポルシェ 911 964/993/996・他車種流用可 <br><br>　車検対応品<br><br>インテリア/ステアリング<tr><td colspan="2">
